### Summary of Core Topics and Concepts

#### Reinforcement Learning (RL)
Reinforcement Learning is a type of machine learning where an agent learns to make decisions by taking actions in an environment to maximize cumulative reward. Key concepts include:

1. **Markov Decision Processes (MDPs):**
   - States, Actions, Rewards, and Transition Probabilities.
   - Value Functions and Policies.

2. **Temporal Difference (TD) Learning:**
   - TD(0) and TD(λ) algorithms.
   - Eligibility Traces: Used to assign credit to past actions.
     - Update Rule: \( e_t = \gamma \lambda e_{t-1} + \nabla \hat{v}(S_t, \theta_t) \)
   - N-step TD Prediction: Extends TD learning over multiple steps to handle delayed rewards.

3. **Q-Learning and Variants:**
   - Q-Learning: Off-policy TD control algorithm.
   - SARSA: On-policy TD control algorithm.
   - Double Q-Learning: Reduces variance in action value estimates.
   - Dueling DQN: Separates the value and advantage functions to improve learning stability.

4. **Function Approximation:**
   - Linear and Non-linear Approximators.
   - Gradient Descent and Semi-Gradient Methods.
   - TD Error: \( \delta = r + \gamma V(s'; w) - V(s; w) \)
   - SGD Update Rule for TD(0): \( w_{t+1} = w_t - \frac{\alpha}{2} \nabla_w \delta^2 \)

5. **Policy Gradient Methods:**
   - REINFORCE Algorithm: \( \Delta \theta_t = \alpha r_t \frac{\nabla \pi_\theta(a_t)}{\pi_\theta(a_t)} \)
   - Baselines: Used to reduce variance in policy gradient estimates.
   - Softmax Policy: \( \pi(\Theta, a_i) = \frac{e^{\theta_i}}{\sum_{j=1}^{n} e^{\theta_j}} \)

6. **Exploration vs. Exploitation:**
   - Strategies for balancing exploration and exploitation.
   - Multi-Arm Bandit Problems.

7. **State Discretization:**
   - Tile Coding: Converts continuous states into discrete representations.
   - Grid Tilings: Different resolutions for discretizing state spaces.

### Important Equations

1. **TD Error:**
   \[ \delta = r + \gamma V(s'; w) - V(s; w) \]

2. **Eligibility Trace Update:**
   \[ e_t = \gamma \lambda e_{t-1} + \nabla \hat{v}(S_t, \theta_t) \]

3. **SGD Update Rule for TD(0):**
   \[ w_{t+1} = w_t - \frac{\alpha}{2} \nabla_w \delta^2 \]

4. **REINFORCE Update Rule:**
   \[ \Delta \theta_t = \alpha r_t \frac{\nabla \pi_\theta(a_t)}{\pi_\theta(a_t)} \]

5. **REINFORCE with Baseline:**
   \[ \Delta \theta_t = \alpha (r_t - b) \frac{\nabla \pi_\theta(a_t)}{\pi_\theta(a_t)} \]

6. **Softmax Policy:**
   \[ \pi(\Theta, a_i) = \frac{e^{\theta_i}}{\sum_{j=1}^{n} e^{\theta_j}} \]

7. **Value Function Approximator:**
   \[ V(s; w) = w_0 + w_1 s + w_2 s^2 + w_3 s^3 \]

